import './App.css';
import React from "react"
import Authenticate from "./Pages/main.js"

class App extends React.Component{
      constructor(props) {
            super(props)

            this.state = {
                  loggedIn : false
            }

            this.handler = this.handler.bind(this)
      }

      handler() {
            this.setState({ loggedIn: true })
      }

      render(){
            return(
                  <div className=''>
                        {
                              this.state.loggedIn ?  <div>Logged in</div> : <Authenticate handler={this.handler}/>
                        }

                  </div>

            )
      }
}





export default App;
